def find_kth_largest(nums, k):
    """"""
    kth_largest = float('-inf')
    for i in range(k):
        max_num = float('-inf')
        for num in nums:
            if num > max_num and (i == 0 or num < kth_largest):
                max_num = num
        kth_largest = max_num
    return kth_largest
